    false,nt"url": null,nt"notes": "This report outlines our findings resulting
    from a month survey (15 July to 11 August, 1970) of raptorial birds along the proposed
    T.A.P.S. route. We were instructed to be primarily concerned with the density and
    status of peregrine falcons along this route. Therefore much of what we say and
    conclude will concern that species. Because of the magnitude of such an undertaking,
    and in light of the function of the project, we confined the majority of our efforts
    to within one to two miles of the proposed route.",nt"license_title": "License
